description:
Rusty Moore's complete Visual Impact Muscle Building. Includes several &quot;special reports&quot; that he sent to his email subscribers along with some videos explaining his thoughts on The Big 3,Soft Bloated Muscle, Shrink Wrap Effect.

All files are in .pdf format and combined into a zip file. No passwords needed!

Also added in Mike Matthews &quot;The Supplement Conspiracy&quot; and Mike Geary's &quot;Insider Secrets for a Lean Body&quot;
